import './Header.css';
import Curriculo from "../../Arquivos/Felipe_camoes.pdf"

import { Link  } from 'react-router-dom/dist/umd/react-router-dom.development';

function Header() {
    return (
        <header className="header">
            <h1>< a href="/" className="name" >Felipe Camões</a></h1>
            <nav>
                <ul>
                    <li><Link to="/pdv"></Link></li>
                    <li><a href='/home' className="link__header">Home</a></li>
                    <li><a href={Curriculo} className="link__header" download={Curriculo}>Curriculo</a></li>
                    <li><a href="https://github.com/felipe-camoes" className="link__header" target="_blank" rel="noreferrer">Git-hub</a></li>
                    <li><a href="https://linkedin.com/in/felipe-camões-9b68701b0" className="link__header" target="_blank"  rel="noreferrer" >Linkedin</a></li>
                </ul>
            </nav>
         
        
        </header>
    );
}

export default Header;
